import React, { useState } from "react";
import axios from "axios";
import "../styles/SignUp.css";

function SignUp() {
  const [user_firstname, setUserfirstname] = useState("");
  const [user_lastname, setUserlastname] = useState("");
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");

  async function save(event) {
    event.preventDefault();
    try {
      await axios.post("http://localhost:8090/api/v1/employee/save", {
        firstname: user_firstname,
        lastname: user_lastname,
        email: email,
        password: password,
      });
      alert("User Registered Successfully");
    } catch (err) {
      alert(err);
    }
  }

  return (
    <div className="wrapper">
      <div className="form-box">
        <div className="register-container" id="register">
          <div className="top">
            <span>
              Have an account?{" "}
              <a href="#" onClick={() => { /* You may want to navigate to the login page here */ }}>
                Login
              </a>
            </span>
            <header>Sign Up</header>
          </div>
          <div className="two-forms">
            <div className="input-box">
              <input
                type="text"
                className="input-field"
                placeholder="Firstname"
                value={user_firstname}
                onChange={(event) => setUserfirstname(event.target.value)}
              />
              <i className="bx bx-user"></i>
            </div>
            <div className="input-box">
              <input
                type="text"
                className="input-field"
                placeholder="Lastname"
                value={user_lastname}
                onChange={(event) => setUserlastname(event.target.value)}
              />
              <i className="bx bx-user"></i>
            </div>
          </div>
          <div className="input-box">
            <input
              type="text"
              className="input-field"
              placeholder="Email"
              value={email}
              onChange={(event) => setEmail(event.target.value)}
            />
            <i className="bx bx-envelope"></i>
          </div>
          <div className="input-box">
            <input
              type="password"
              className="input-field"
              placeholder="Password"
              value={password}
              onChange={(event) => setPassword(event.target.value)}
            />
            <i className="bx bx-lock-alt"></i>
          </div>
          <div className="input-box">
            <button
              type="submit"
              className="submit"
              onClick={save}
            >
              Sign Up
            </button>
          </div>
          <div className="two-col">
            <div className="one">
              {/* You may add checkbox and label here */}
            </div>
            <div className="two">
              <label>
                <a href="#">Terms & conditions</a>
              </label>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default SignUp;



